data_prepare_config:
for item in d['operations']:
    del item['data']['id']
    del item['lookup']['id']
    item['data']['region'] = 4
    item['lookup']['region'] = 4
    if item['data']['type'] != 'SERVICE_LOCATION':
        del item['data']['parentClient']
    if item['data']['address']['addressLine1'] == '':
        del item['data']['address']
    elif item['data']['address']['addressLine1'] != '':
        if item['data']['address']['city'] == '':
            item['data']['address']['city'] = ' '
        if item['data']['address']['state'] == '':
            item['data']['address']['state'] = ' '
        if item['data']['address']['country'] == '':
            item['data']['address']['country'] = ' '
        if item['data']['address']['postalCode'] == '':
            item['data']['address']['postalCode'] = ' '

